    TextButton_2.MouseButton1Click:Connect(function() 
        local Keys = KeyTextBox.Text;

        local status
        for attempt = 1, 3 do
            print("[PELINDA] Attempt #" .. attempt .. " validating key...")
            status = Pelinda.Init({
                Service = __PELINDA_SERVICE__,
                SilentMode = __PELINDA_SILENTMODE__,
                Key = tostring(Keys),
                SecurityLevel = __PELINDA_SECURITY_LEVEL__
            })

            if status == "validated!!" then
                print("[PELINDA] Key validated on attempt #" .. attempt)
                break
            else
                print("[PELINDA] Attempt #" .. attempt .. " failed.")
            end
            TextButton_2.Text = "CHECKING!"
            task.wait(0.5)
        end

        if Keys == "" then
            TextButton_2.Text = "INVALID!"
            wait(.2)
            TextButton_2.Text = "Redeem"
            print("Key cant be empty!")
            return
        end

        if status == "validated!!" then
            TextButton_2.Text = "VALID!"
            print("Key valid! Loading script...")
            writefile("xerichub.txt", Keys)
            local FrameTestor = game:GetService("Players").LocalPlayer:WaitForChild("PlayerGui"):FindFirstChild("ScreenGui")
            if FrameTestor then
                FrameTestor:Destroy()
                print("UI closed.")
                task.wait()
                MakeScriptHub()
            else
                warn("MainFrame not found.")
            end
        else
            TextButton_2.Text = "INVALID!"
            print("Key Invalid!")
            wait(.5)
            TextButton_2.Text = "Redeem"
        end
    end)
