spawn(function()
    pcall(function()
        local ExistingKey = isfile("xerichub.txt")
        if ExistingKey then
            local success, KeyFound = pcall(function()
                return readfile("xerichub.txt")
            end)

            if success and KeyFound and KeyFound ~= "" then
                KeyFound = KeyFound:gsub("%s+", "") 
                print("Validating your key...")
                local status
                local validated = false

                for attempt = 1, 3 do
                    print("Key Validation Attempt #" .. attempt)
                    local ok, result = pcall(function()
                        return Pelinda.Init({
                            Service = __PELINDA_SERVICE__,
                            SilentMode = __PELINDA_SILENTMODE__,
                            Key = KeyFound,
                            SecurityLevel = __PELINDA_SECURITY_LEVEL__
                        })
                    end)

                    if ok and result == "validated!!" then
                        status = result
                        validated = true
                        break
                    end
                    task.wait(.5)
                end

                if validated then
                    print("Success Load")
                else
                    print("Expired or Invalid Key")
                    ShowKeySystem()
                end
            else
                ShowKeySystem()
            end
        else
            ShowKeySystem()
        end
    end)
end)


